          s: { shape: "ellipse", fill: "#ff0000" }, // Spiral galaxy
          s0: { shape: "ellipse", fill: "#ff0000" }, // Lenticular galaxy
          sd: { shape: "ellipse", fill: "#ff0000" }, // Dwarf galaxy
