      },
      planets: {
        //Show planet locations, if date-time is set
        show: false,
        // List of all objects to show
        which: [
          "sol",
          "mer",
          "ven",
          "ter",
          "lun",
          "mar",
          "jup",
          "sat",
          "ura",
          "nep"
        ],
