        show: false
      }
    };

    const DATE = new Date("2021-09-25T04:00:00+0000");
    const [LAT, LON] = [36.525321, -121.815916];
    const FONT = "Raleway";

    const config = {
      container: "map",
      width: 0,
      datapath: "../../../assets/data/", // Path/URL to data files, empty = subfolder 'data'

      form: false,
      advanced: false,
      interactive: false,
      disableAnimations: true,

