        show: false,
        which: ["mer", "ven", "ter", "lun", "mar", "jup", "sat"],

        symbolType: "disk",
        names: true,
        nameStyle: {
          fill: "#00ccff",
          font: `14px ${FONT}`,
          align: "center",
          baseline: "top"
        },
        namesType: "en"
      },

      dsos: {
        show: false,
        names: false
      },

      constellations: {
        names: false,
        namesType: "iau",
        nameStyle: {
          fill: "#ffffff",
          align: "center",
          baseline: "middle",
          font: [`14px ${FONT}`, `8px ${FONT}`, `0px ${FONT}`]
        },
        lines: true,
        lineStyle: { stroke: "#cccccc", width: 1, opacity: 0.4 }
      },

      mw: {
        show: true,
        style: { fill: "#ffffff", opacity: 0.02 }
      },

      background: {
        fill: this.style?.globe || "#D2001A", // globe color
        stroke: "#EFEFEF",
        opacity: 1,
        width: 2
      },

      stars: {
        colors: true,
        size: 4,
        limit: 6,
        exponent: -0.28,
        designation: false,

        propername: false,
        propernameType: "name",
        propernameStyle: {
          fill: "#ddddbb",
          font: `8px ${FONT}`,
          align: "right",
          baseline: "center"
        },
        propernameLimit: 2.0
      }
    };

    Celestial.display(config);
    Celestial.skyview({ date: DATE });
  }
}

