          lon: {
            pos: [""],
            fill: "#eee",
            font: "10px Helvetica, Arial, sans-serif"
          },
          // grid values: "outline", "center", or [lon,...] specific position
          lat: {
            pos: [""],
            fill: "#eee",
            font: "10px Helvetica, Arial, sans-serif"
          }
        },
        equatorial: { show: true, stroke: "#aaaaaa", width: 1.3, opacity: 0.7 },
        ecliptic: { show: true, stroke: "#66cc66", width: 1.3, opacity: 0.7 },
        galactic: { show: false, stroke: "#cc6666", width: 1.3, opacity: 0.7 },
        supergalactic: { show: false, stroke: "#cc66cc", width: 1.3, opacity: 0.7 }
      },
      background: {
        // Background style
        fill: "#000000", // Area fill
        opacity: 1,
        stroke: "#000000", // Outline
        width: 1.5
      },
      horizon: {
        //Show horizon marker, if location is set and map projection is all-sky
        show: false,
        stroke: "#cccccc", // Line
        width: 1.0,
        fill: "#000000", // Area below horizon
        opacity: 0.5
      },
      daylight: {
        //Show day sky as a gradient, if location is set and map projection is hemispheric
        show: false
      }
    };

    const DATE = new Date("2021-09-25T04:00:00+0000");
    const [LAT, LON] = [36.525321, -121.815916];
    const FONT = "Raleway";

    const config = {
      container: "map",
      width: 0,
      datapath: "../../../assets/data/", // Path/URL to data files, empty = subfolder 'data'

      form: false,
      advanced: false,
      interactive: false,
      disableAnimations: true,

      zoomlevel: null,
      zoomextend: 1,

      projection: "airy",
      transform: "equatorial",

      follow: "zenith",
      geopos: [LAT, LON],

      lines: {
        graticule: { show: false },
        equatorial: { show: false },
        ecliptic: { show: false },
        galactic: { show: false },
        supergalactic: { show: false }
      },

      planets: {
        show: false,
        which: ["mer", "ven", "ter", "lun", "mar", "jup", "sat"],

        symbolType: "disk",
        names: true,
        nameStyle: {
          fill: "#00ccff",
          font: `14px ${FONT}`,
          align: "center",
          baseline: "top"
        },
        namesType: "en"
      },

      dsos: {
        show: false,
        names: false
      },

      constellations: {
        names: false,
        namesType: "iau",
        nameStyle: {
          fill: "#ffffff",
          align: "center",
          baseline: "middle",
          font: [`14px ${FONT}`, `8px ${FONT}`, `0px ${FONT}`]
        },
        lines: true,
        lineStyle: { stroke: "#cccccc", width: 1, opacity: 0.4 }
      },

      mw: {
        show: true,
        style: { fill: "#ffffff", opacity: 0.02 }
      },

      background: {
        fill: this.style?.globe || "#D2001A", // globe color
        stroke: "#EFEFEF",
        opacity: 1,
        width: 2
      },

      stars: {
        colors: true,
        size: 4,
        limit: 6,
        exponent: -0.28,
        designation: false,

        propername: false,
        propernameType: "name",
        propernameStyle: {
          fill: "#ddddbb",
          font: `8px ${FONT}`,
          align: "right",
          baseline: "center"
        },
        propernameLimit: 2.0
      }
    };

    Celestial.display(config);
    Celestial.skyview({ date: DATE });
  }
}

